#include <math.h>
#include <string.h>
#define TAM 47

void qr_method_original_dense_(int *n, double dataQ[][*n], double dataR[][*n]){
    int j, k, m;
    double sum = 0;

    for (k = 0; k < TAM; k++){
        sum = 0;
        for (m = 0; m < TAM; m++){
            sum += dataQ[m][k] * dataQ[m][k];
        }
        dataR[k][k] = sqrt(sum);

        for (m = 0; m < TAM; m++) {
            dataQ[m][k] = dataQ[m][k]/dataR[k][k];
        }

        for (j = k+1; j < TAM; j++){
            sum = 0;
            for (m = 0; m < TAM; m++){
                sum += dataQ[m][j] * dataQ[m][k];
            }
            dataR[k][j] = sum;

            sum = 0;
            for (m = 0; m < TAM; m++){
                dataQ[m][j] = dataQ[m][j] - (dataR[k][j] * dataQ[m][k]);
            }
        }
    }
}

void qr_method_article_dense_(int *n, double dataQ[][*n], double dataR[][*n]){
    int j, k, m;
    double sum = 0;
    double r2[TAM];
    double rn[TAM][TAM];
    memset(r2, 0, sizeof(r2));
    memset(rn, 0, sizeof(rn));

    for (k = 0; k < TAM; k++) {
        sum = 0;
        for (m = 0; m < TAM; m++) {
            sum += dataQ[m][k] * dataQ[m][k];
        }

        r2[k] = sum;

        for (j = k + 1; j < TAM; j++) {
            sum = 0;
            for (m = 0; m < TAM; m++) {
                sum += dataQ[m][k] * dataQ[m][j];
            }
            rn[k][j] = sum;
        }

        for (j = k + 1; j < TAM; j++) {
            for (m = 0; m < TAM; m++) {
                dataQ[m][j] = dataQ[m][j] - ((rn[k][j] / r2[k]) * dataQ[m][k]);

            }
        }
    }

    for (k = 0; k < TAM; k++) {
        dataR[k][k] = sqrt(r2[k]);

        for (j = k + 1; j < TAM; j++) {
            dataR[k][j] = rn[k][j] / dataR[k][k];
        }

        for (m = 0; m < TAM; m++) {
            dataQ[m][k] = dataQ[m][k]/dataR[k][k];
        }
    }
}

